The query could be escaped using a double quote in the key parameter and then fully exploited to gain RCE:
{
  "username":{
    "foo\"; INJECTED SQL QUERY;-- -":"bar"
  },
  "password":"pass2"
}

The login request was JSON encoded like so:
{
  "username":"user1",
  "password":"pass2"
}

When providing an object as the username an SQL error appeared:
{
  "username":{
    "foo":"bar"
  },
  "password":"pass2"
} 

Showing that "foo" had been concatenated to the SQL query

